import React from "react";
import { logoTransparent } from "../assets";

const Header = () => {
  return (
    <div className="w-full bg-white border-b border-b-gray-800 h-20">
      <div className="max-w-screen-xl h-full mx-auto flex items-center justify-between">
        <div>
          <img src={logoTransparent} className="w-28" alt="logo" />
        </div>
      </div>
      <div>
        <ul>
          <li>Home</li>
          <li>Pages</li>
          <li>Shop</li>
          <li>Element</li>
          <li>Blog</li>
        </ul>
      </div>
    </div>
  );
};

export default Header;
